import { useState, } from "react";
import { json } from "react-router-dom";


function JsonForm(){
  const [name,setName]=useState("")
  const [coures,setCoures]=useState("")
  const [city,setCity]=useState("")

  const fistName=(a)=>{
    setName(a.target.value)
  }
  const fistCoures=(a)=>{
    setCoures(a.target.value)
  }
  const fistCity=(a)=>{
    setCity(a.target.value)
  }
  
   const handleSubmited=()=>{
    const data=[name,coures,city]
        fetch("http://localhost:3006/Curd-Json",{
      method:"POST",
      headers:{
        "content type":"appliaction/json"
      },
      body:JSON.stringify(data)
    })
    .then(()=>{
      alert("succesfully saved")
    })
    .catch((err)=>{
      console.log(err.message)
    })
   }
  return(
    <div>
      <form onSubmit={handleSubmited}>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Name</label>
    <input type="text" value={name} onChange={fistName} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Coures</label>
    <input type="text" value={coures} onChange={fistCoures} className="form-control" id="exampleInputPassword1"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">  City</label>
    <input type="text" value={city} onChange={fistCity} className="form-control" id="exampleInputPassword1"/>
  </div>
  
  <button type="submit" class="btn btn-primary">Submit</button>
</form>

    </div>
  )
}
export default JsonForm;
